const Item = (props) => {
	const v = props.details;

	return (<>
		<div className="bg-red-100 rounded-xl my-5 p-3 flex flex-row">
			<div className="flex-1 rounded-3xl overflow-hidden">
				<div className="w-full">
					<img src={v.img} alt={v.name} />
				</div>
			</div>
			<div className="flex-1 p-2">
				<h1 className="text-red-500 text-md font-bold">{v.name}</h1>
				<span className="py-1 px-2 rounded-3xl bg-yellow-500 text-white text-xs">
					<img src={'/imgs/'} alt="type" width="15" height="15" />
					{v.type}
				</span>
			</div>
		</div>
	</>);
}
 
export default Item;
